import { Link } from 'react-router-dom'

function CardComponent(props) {
    return (
        <>
            <section>
                <div>
                    {props.data.map((item, index) => (
                        <div key={index}>
                            <h3>{item.props.data.title}</h3>
                            <Link to={`/info/${item.props.data.title}/`}>Дивитись статтю</Link>
                        </div>
                    ))}
                </div>
            </section>
        </>
    )
}

export default CardComponent
